import React from 'react';
import { Container, Nav, Navbar } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <Navbar>

            <Container>

                <Link to="/">
                    <Navbar.Brand >공공데이터 프로젝트</Navbar.Brand>
                </Link>
                <Nav>첫번째</Nav>
                <Nav>두번째</Nav>

            </Container>


        </Navbar>
    );
};

export default Header;
